import React from 'react';

function ListView() {

    const colors = ['#3e9cbf', '#a7ecf2', '#f2c43d', '#f17c37', '#f26d50'];

    return(
        <div>
            {
            colors.map((color) => (
            <div key={color} style={{width: 200, height: 50, backgroundColor: color, justifyContent: 'center'}}>
                <a>tile</a>
            </div>
            ))
            }
        </div>
    )
}

export default ListView;
